融、人工智能等领域。','AboutUsConfig-','2018-09-11 18:06:36','2018-09-19 19:03:46','0'),('abfccc52e9ca4779b80495accb499fdb','nullAboutUs','关于我们的配置，啦啦啦啦啊',NULL,'2018-09-06 20:50:41','2018-09-11 10:32:04','0'),('ac8990fd6df0499cac3e9d2488aa9b2d','IndexConfig-AboutUSFourText','遍布全球','IndexConfig-','2018-09-11 18:20:41','2018-09-20 10:02:20','0'),('adb2499badb242b7b72b087c5ec80d76','SettlementCommonConfig-FilterInterface','','SettlementCommonConfig-','2019-09-10 16:17:15','2019-09-10 16:17:15','0'),('ae485e70d5d748bdbb0981f062fe7a79','IndexConfig-CoreOneUrl','/corebusiness.html','IndexConfig-','2018-09-11 16:31:39','2018-09-20 10:02:20','0'),('af1653818fc64453b92865c47229450d','SettlementCommonConfig-IsEnableAdminLoginMobileCheck','1','SettlementCommonConfig-','2018-10-18 11:57:04','2019-09-10 16:17:15','0'),('afaa10ef5e1c4815b679faa471df85cd','nullIsEnableWaiXinImg','1',NULL,'2018-09-06 20:51:04','2018-09-10 14:41:41','0'),('b027096903ba4d0a8cb842cfd9bb3721','IndexConfig-CoreFourImage','/files/dea4bcd2-f0c7-4ee4-82aa-5cee98d21fb6.jpg','IndexConfig-','2018-09-11 16:31:39','2018-09-20 10:02:20','0'),('b085c257906b4dbb836d8fc102a0f359','IndexConfig-AboutUSImg','/img/noPicture.jpg','IndexConfig-','2018-09-11 16:31:39','2018-09-11 16:31:39','0'),('b412995feba043fc87e035d8f17fe4be','CommonConfig-Address','深圳市福田区福田海岸环庆大厦1404-1405室','CommonConfig-','2018-09-11 11:25:05','2018-09-19 16:00:35','0'),('b70f062f2cc1405599998c4ec7e09004','SettlementCommonConfig-MinWithLimit','','SettlementCommonConfig-','2019-09-10 16:17:15','2019-09-10 16:17:15','0'),('be006dbfd4c640c48f407bcbff3d6b6a','IndexConfig-AboutUSTwoText','资源交流','IndexConfig-','2018-09-11 18:20:41','2018-09-20 10:02:20','0'),('be156e7c8042428ea548843f4caad4ef','SettlementCommonConfig-WebsiteURL','http://10.235.20.42:8080','SettlementCommonConfig-','2019-02-22 16:55:07','2019-09-10 16:17:15','0'),('be29905759d341bea816803d3eb4be8b','SettlementCommonConfig-UserNumOfL1','5000','SettlementCommonConfig-','2019-09-10 16:17:15','2019-09-10